import React from 'react';
import './about_us.css'; // Asegúrate de que este archivo incluya los estilos de Achievements.
import History from './history/history';
import Testimony from './testimony/testimony';
import Team from './team/team';

import HistoryPicture from '../../assets/banners/Banner5.jpeg'; // Asegúrate de que la ruta de la imagen sea correcta.

const AboutUs = () => {
  return (
    <div className="about-us-container">
      
      {/* Sección del Banner */}
      <div className="achievements-banner">
        <h1>Conócenos</h1>
        <p>Bienvenida a Nuestra Institución</p>
      </div>

      {/* Sección de Bienvenida */}
      <div className="section white-section">
        <div className="white-section-content">
          <p>Texto introductorio sobre la institución y su misión.</p>
        </div>
      </div>

      {/* Sección de Nuestro Equipo */}
      <div className="section white-section">
        <div className="white-section-content">
          <img src={HistoryPicture} alt="Nuestro Equipo" className="team-photo"/>
          <h2>Nuestro Equipo</h2>
          <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry...</p>
          <Team />
        </div>
      </div>

      {/* Sección de Historia */}
      <div className="section white-section">
        <div className="white-section-content">
          <img src={HistoryPicture} alt="Nuestra Historia" className="history-photo"/>
          <h2>Nuestra Historia</h2>
          <History />
          <p>Lorem Ipsum is simply dummy text of the printing and typesetting industry...</p>
        </div>
      </div>

      {/* Secciones adicionales como Instalaciones, Compromiso, Testimonios */}
      {/* ... */}

    </div>
  );
};

export default AboutUs;
